import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('domcontentloaded');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for cart element and click it
    const cartSelector = 'div.cart';
    await page.waitForSelector(cartSelector, { timeout: 5000 });
    await page.click(cartSelector);

    // Wait for cart modal to appear and take screenshot
    const cartModalSelector = '#cartModal';
    await page.waitForSelector(cartModalSelector, { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_cart_modal.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_cart_modal.png'));

    // Verify cart modal is visible
    const isModalVisible = await page.isVisible(cartModalSelector);
    const cartTitle = await page.textContent('.cart-content h2').catch(() => null);

    return {
      success: true,
      action: "Successfully opened shopping cart modal",
      extractedData: {
        modalVisible: isModalVisible,
        cartTitle: cartTitle
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to open shopping cart modal",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
